!--------------------------------------------------------------------
  subroutine shift(vaux,id,step,jd)
    integer, intent(in)    :: id
    integer, intent(in)    :: jd
    integer, intent(in)    :: step 
    real(8), intent(inout) :: vaux(*)

    integer :: i,j 
    integer :: ij_old,ij_new
    
    ij_old = 0
    ij_new = 0
    do j=1,jd
      do i=1,id
        vaux(ij_new+i)=vaux(ij_old+i)
      enddo
      ij_new = ij_new + id
      ij_old = ij_old + id + step 
    enddo
  end subroutine
